import './App.css';

function App() {
  let judul = "Halo Dunia"

  const handleOnClick = (event) => {
    judul = "halo"
  }

  return (
    <div className="App">
      <h1>{judul}</h1>
      <button onClick={handleOnClick}>Ganti</button>
    </div>
  );
}

export default App;
